import React from "react";
import logo from "../images/F-logo.png";
import  '../css/SideBar.css'
import Home from '../images/icons/home.png';
import Compass from '../images/icons/compass.png'

export default function SideBar() {
  return (
    <div>
      <div className="S">
        <div className="S-1">
          <img src={logo}></img>
        </div>

        <div className="S-2">
            <ul>
              <li><img src={Home}></img></li>
            </ul>
        </div>

        <div className="S-3">

        </div>
      </div>
    </div>
  );
}
